import React from 'react';
import { Link } from 'react-router-dom';



const NavBar = () => (
  <nav>
    <ul>
      <li>
        <Link to="/">Home</Link>
        <Link to="/add-new-vacancy/">Add new Job</Link>
        <Link to="/register/">Add new Job</Link>
      </li>
    </ul>
  </nav>
);

export default NavBar;
